<prop name=\"port_67\"><![CDATA[service-dhcp_alive]]></prop>\n<prop name=\"port_8080\"><![CDATA[service-tomcat_alive]]></prop>\n<prop name=\"port_194\"><![CDATA[service-irc_alive]]></prop>\n<prop name=\"port_22\"><![CDATA[service-ssh_alive]]></prop>\n</data>','Nmap');
